classitems.description:
Pushes new element to array.

Example of usage:
data-bind="click: $root.add_data.bind( $data, $root.some_array, $root.vhandler )"
where $root.vhandler is a function, which creates data.

$root.vhandler example:
self.handler = function() {
  var self = this;
  self.arg1 = ko.observable( 'value1' );
  self.arg2 = 'value2';
}

Internal logging function.

Basic Usage:
- ud.log( 'I need a shower.' );
- ud.log( 'There is no water.', 'error' );
- ud.log( { some: 'information' } );
- ud.log( new Error( 'Error message.') );

Advanced Usage:
- ud.log( 'As long as the second variable is not a string, all additional variables will be added to the log:', { one: 'test', two: 'test' }, { puppies: 'yes', kittens : 'no' }, 7, 2 );
- ud.log( cat === big , 'If we have a small cat, this message will not be displayed at all. When first variable is a boolean, it must be true for rest of variables to be displayed..' );

Request Emitter (Standard way of doing requests)

Paths should begin with a forwardslash and end without a trailing slash.

app.request( METHOD, PATH, [ARGS, CALLBACK()]);

example:
var Activity = require( 'udx.utility.activity' );

Activity.create({
  ajax: 'admin-ajax.php?action=some-task',
  args: {
    id: 'some-task',
  },
  interval: 100,
  onError: function() {},
  onComplete: function() {}
});

require( 'udx.utility.process' ).create({
  id: 'some-task',
  url: 'admin-ajax.php?action=some-task',
  interval: 100,
  onError: function() {},
  onComplete: function() {}
});

